// HasOperationLogFromUser applies the HasEdge predicate on the "operation_log_from_user" edge.
func HasOperationLogFromUser() predicate.CoreOperationLog {
	return predicate.CoreOperationLog(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, OperationLogFromUserTable, OperationLogFromUserColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasOperationLogFromUserWith applies the HasEdge predicate on the "operation_log_from_user" edge with a given conditions (other predicates).
func HasOperationLogFromUserWith(preds ...predicate.CoreUser) predicate.CoreOperationLog {
	return predicate.CoreOperationLog(func(s *sql.Selector) {
		step := newOperationLogFromUserStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.CoreOperationLog) predicate.CoreOperationLog {
	return predicate.CoreOperationLog(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.CoreOperationLog) predicate.CoreOperationLog {
	return predicate.CoreOperationLog(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.CoreOperationLog) predicate.CoreOperationLog {
	return predicate.CoreOperationLog(sql.NotPredicates(p))
}
